import React from 'react';
import ReactDOM from 'react-dom/client';
import { useParams } from "react-router-dom";

function Detail(){
    const {id} = useParams();
    useEffect(()=> {
        fetch(`https://yts.mx/api/v2/movie_details.json?movie_id=${id}`)
    },[]);
    return <h1>Detial</h1>;
}

export default Detail;
